INSERT INTO `company_details` (`id`, `company_id`, `sphere`, `description`, `logo`, `created_at`, `updated_at`) VALUES 
	(1,2,'asd','<p><em><strong>Компания "Ристарт Технологии" - интегратор IT-решений для автоматизации бизнеса.</strong></em><br /><br />Наша миссия: Дать клиентам возможность использовать инновационные IT решения и увеличивать прибыль.<br />Мы даем возможности для роста и раскрытия потенциала каждому сотруднику;<br />Стремимся к осознанности;<br />Ценим Family Time.<br /><br />Наши основные направления:<br />Внедрение, сопровождение и доработка программных продуктов 1С<br />Автоматизация розничных торговых точек с использованием торгового оборудования (принтеры чеков, сканеры штрих-кода и т.п.)<br />Внедрение и сопровождение IP телефонии и интеграция IP телефонии с программными продуктами 1С<br />Интеграция 1С с интернет магазинами и маркетплейсами<br />Внедрение и сопровождение продуктов 1С-Битрикс, Битрикс24<br /><br />Наш офис находится в тихом и спокойном месте в верхней части города, на территории офисного городка "Азия-Мост".</p>','data:image/png;base64,','2022-03-10 08:26:02','2022-03-19 19:08:23');
